import './styles/Welcome.css';
import GameMenu from './GameMenu';
import {
	Link,
	Route,
	Switch,
	useRouteMatch
} from 'react-router-dom';

type RouteType = {
	path: string
}

const Welcome = () => {
	const { path } = useRouteMatch<RouteType>();

	return (
		<div className="welcome">
			<h1 className="welcome__title">TIC TAC TOE</h1>
			<div className="welcome__menu">
				<Switch>
					<Route path={`${path}`}>

					</Route>
					<Route path={path}>
						<GameMenu>
							<li>
								<Link to="/game/3">3 x 3 mode (possible AI opponent)</Link>
							</li>
							<li>
								<Link to="/game/10">10 x 10 mode</Link>
							</li>
						</GameMenu>
					</Route>
				</Switch>

			</div>
		</div>
	)
}

export default Welcome;
